import React from 'react';

function Post({ post }) {
  return (
    <div className="post">
      <h2>dangerouslySetInnerHTML={{ __html: post.title }}</h2>
      <p>Date Posted: {post.datePosted}</p>
      <p>Written By: {post.writtenBy}</p>
      <div
        dangerouslySetInnerHTML={{ __html: post.preview }}
      />
      <a href={post.link} target="_blank" rel="noopener noreferrer">
        Read More
      </a>
    </div>
  );
}

export default Post;
